export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},VadRLsXHtD:{data:{id:865,attributes:{imdbId:"tt1840309",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTYxMzYwODE4OV5BMl5BanBnXkFtZTgwNDE5MzE2MDE@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"41%"},{Source:"Metacritic",Value:"48\u002F100"}],item_lang:{data:{id:1528,attributes:{title:h,plot:"Set in a futuristic dystopia where society is divided into five factions that each represent a different virtue, teenagers have to decide if they want to stay in their faction or switch to another - for the rest of their lives. Tris Prior makes a choice that surprises everyone. Then Tris and her fellow faction-members have to live through a highly competitive initiation process to live out the choice they have made. They must undergo extreme physical and intense psychological tests, that transform them all. But Tris has a secret that she is Divergent, which means she doesn't fit into any one group. If anyone knew, it would mean a certain death. As she discovers a growing conflict that threatens to unravel her seemingly peaceful society, this secret might help her save the people she loves... or it might destroy her.",slug:"divergent"}}},books:{data:[{id:5299,attributes:{title:"Divergent Series Four-Book Paperback Box Set",description:"The definitive box set for Divergent fans! This four-book set includes paperbacks of the three books in the #1 New York Times bestselling Divergent trilogy, plus the companion volume told from the perspective of the immensely popular character Tobias, all wrapped up in a dazzling keepsake box. This set is perfect for established fans who want to own the full Divergent library, readers new to the series, or fans of the blockbuster films starring Shailene Woodley, Theo James, and Kate Winslet. Divergent: One choice can transform you. Veronica Roth's debut is a gripping dystopian tale of electrifying choices, powerful consequences, unexpected romance, and a deeply flawed \"perfect society.\" Includes bonus materials by Veronica Roth. Insurgent: One choice can destroy you. The second bestseller continues the dystopian thrill ride. As war surges in the factions all around her, Tris attempts to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love. Includes bonus materials by Veronica Roth. Allegiant: One choice will define you. The explosive conclusion to the #1 New York Times bestselling Divergent trilogy reveals the secrets of the dystopian world that has captivated millions of readers. Includes bonus materials by Veronica Roth. Four: A Divergent Collection: A companion volume to the worldwide bestselling Divergent series, told from the perspective of Tobias. The four pieces included—\"The Transfer,\" \"The Initiate,\" \"The Son,\" and \"The Traitor\"—plus three additional scenes, give readers a fascinating glimpse into the history and heart of Tobias, and set the stage for the epic saga of the Divergent trilogy.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=a9khswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2016-01-19",publisher:d,subtitle:"Divergent, Insurgent, Allegiant, Four"}},{id:5300,attributes:{title:h,description:"This first book in Veronica Roth's #1 New York Times bestselling Divergent trilogy is the novel that inspired the major motion picture starring Shailene Woodley, Theo James, and Kate Winslet. This dystopian series set in a futuristic Chicago has captured the hearts of millions of teen and adult readers. Perfect for fans of the Hunger Games and Maze Runner series, Divergent and its sequels, Insurgent and Allegiant—plus Four: A Divergent Collection, four stories told from the perspective of the character Tobias—are the gripping story of a dystopian world transformed by courage, self-sacrifice, and love. Fans of the Divergent movie will find the book packed with just as much emotional depth and exhilarating action as the film, all told in beautiful, rich language. The paperback edition includes bonus materials created by Veronica Roth, including her essays on Utopian worlds and how she named the factions, writing tips, a Q&A, a Divergent playlist, faction manifestos, and an excerpt from Insurgent. One choice can transform you. Beatrice Prior's society is divided into five factions—Candor (the honest), Abnegation (the selfless), Dauntless (the brave), Amity (the peaceful), and Erudite (the intelligent). Beatrice must choose between staying with her Abnegation family and transferring factions. Her choice will shock her community and herself. But the newly christened Tris also has a secret, one she's determined to keep hidden, because in this world, what makes you different makes you dangerous. Supports the Common Core State Standards",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p1D3oAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2014-09-30",publisher:d,subtitle:f}},{id:5301,attributes:{title:"Divergent Series Complete Box Set",description:"Veronica Roth's entire Divergent trilogy is available together for the first time, with a bonus booklet about the series. Perfect for gift givers, collectors, and fans new to the series, the complete collection includes the full text of Divergent, Insurgent, and Allegiant, plus \"The World of Veronica Roth's Divergent Series,\" a forty-eight-page booklet including faction manifestos, a faction quiz and results, a Q&A with Veronica Roth, playlists, discussion questions, series inspirations, and much more! Divergent: One choice can transform you. Veronica Roth's #1 New York Times bestselling debut is a gripping dystopian tale of electrifying choices, powerful consequences, unexpected romance, and a deeply flawed \"perfect society.\" Insurgent: One choice can destroy you. Veronica Roth's second #1 New York Times bestseller continues the dystopian thrill ride. As war surges in the factions all around her, Tris attempts to save those she loves—and herself—while grappling with haunting questions of grief and forgiveness, identity and loyalty, politics and love. Allegiant: The explosive conclusion to Veronica Roth's #1 New York Times bestselling Divergent trilogy reveals the secrets of the dystopian world that has captivated millions of readers in Divergent and Insurgent.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Vt9JmQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2013-10-22",publisher:d,subtitle:f}},{id:5302,attributes:{title:"Four: A Divergent Collection",description:"Complete your Divergent library with Four! Fans of the Divergent series by #1 New York Times bestselling author Veronica Roth will be thrilled by Four: A Divergent Collection, a companion volume that includes four pre-Divergent stories plus three additional scenes from Divergent, all told from Tobias's point of view. Readers first encountered Tobias as \"Four\" in Divergent. His voice is an integral part of Allegiant. Readers will find more of this charismatic character's backstory told from his own perspective in Four: A Divergent Collection. When read together, these long narrative pieces illuminate the defining moments in Tobias's life. The first three pieces in this volume—\"The Transfer,\" \"The Initiate,\" and \"The Son\"—follow Tobias's transfer from Abnegation to Dauntless, his Dauntless initiation, and the first clues that a foul plan is brewing in the leadership of two factions. The fourth story, \"The Traitor,\" runs parallel with the events of Divergent, giving readers a glimpse into the decisions of loyalty—and love—that Tobias makes in the weeks after he meets Tris Prior. Includes three exclusive scenes!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RlhZnwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2014-07-08",publisher:d,subtitle:f}},{id:5303,attributes:{title:"Divergent Collector's Edition",description:"The #1 New York Times bestseller that started a worldwide phenomenon and inspired a major motion picture is now available in a beautifully designed Collector's Edition. This deluxe package features: 72 pages of bonus content, including: Two essays by Veronica Roth, including excerpts from early drafts of Divergent An essay about the psychology behind fear and the \"exposure therapy\" of Dauntless initiation Artistic renderings of the Choosing Ceremony Bowls An excerpt from the movie script Favorite quotes from Divergent, illustrated by fellow Initiates A map of the Dauntless compound Divergent discussion questions This edition makes a great gift for established fans who want to expand their Divergent library or who already own the Insurgent Collector's Edition; readers new to the series who want a fuller reading experience; and fans of the feature film. Taking place in a futuristic Chicago in which society is divided into five factions, Divergent is the gripping story of a dystopian world transformed by courage, self-sacrifice, and love. And don't miss The Fates Divide, Veronica Roth's powerful sequel to the bestselling Carve the Mark!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hftzAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:"2014-10-21",publisher:"Harper Collins",subtitle:f}}]}}},meta:{}}},prerenderedAt:1688531333329}}("movie","Veronica Roth","series","Katherine Tegen Books",null,"",1,"Divergent"))